function onePerMonth(dayData, index) {
  return index % 20 === 0;
}

function dateInYears(date) {
  var yearInSeconds = moment(date).format('X');
  var yearFloat = yearInSeconds / 31556926 + 1970;
  return Math.round(yearFloat * 1000) / 1000;
}

function keepTwoColumns(dayData) {
  return [dateInYears(dayData[0]), dayData[1]];
}

